                {restAreas.map((area) => (
                    <MapMarker key={area.id} position={{ lat: area.위도, lng: area.경도 }}
                               onClick={() => handleMarkerClick(area)}>
                    </MapMarker>
                ))}
            </Map>
        </>
    )
}

export default jejuMap;
